import React from "react";

type ButtonProps = {
  name: string;
  btnType?: string;
  type?: "button" | "submit" | "reset" | undefined;
  isMediaUploading?: boolean;
  isSubmitting?: boolean;
  isDisabled?: boolean;
  saveData?: any;
  className?: string;
};

const Button: React.FC<ButtonProps> = ({
  isSubmitting,
  isMediaUploading,
  name,
  type,
  saveData,
  btnType,
  isDisabled,
  className,
}) => {
  return <div>Button</div>;
};

export default Button;
